import {
  BrowserRouter as Router,
  Route,
  Switch,
  link,
  Redirect,
} from "react-router-dom";

//Pages
import MainPage from "./pages/index";

const urlEndpoint = "https://ik.imagekit.io/4s0yrabzrtp/";

class App extends Component {
  render() {
    return (
      <Router>
        <Route path="/" component={MainPage} />
      </Router>
    );
  }
}

export default App;
